seUrl":"/@SuperSimpleDev"}},"contentText":{"runs":[{"text":"I've created the lesson plan for the updated JavaScript course. It is 210 pages long - it's like I wrote an e-book on JavaScript and now I'm making the video for the e-book \n\nHere are the lessons (potentially):\nLesson 1: Intro to JavaScript \nLesson 2: Numbers and Math\nLesson 3: Strings\nLesson 4: HTML \u0026 CSS Review, \u003cscript\u003e, Comments\nLesson 5: Variables\nLesson 6: Booleans and if-statements\nLesson 7: Functions\nLesson 8: Objects\nLesson 9: DOM (Document Object Model)\nLesson 10: Arrays and Loops\nLesson 11: Advanced Functions (Callbacks and Closures)\nLesson 12: Start the project + Intro to Git\nLesson 13: Modules\nLesson 14: External libraries + making the project interactive\nLesson 15: Testing\nLesson 16: Object Oriented Programming (OOP)\nLesson 17: Finish the project\nLesson 18: More DOM features\nLesson 19: Advanced OOP and JavaScript Frameworks\nLesson 20: Backend, Promises, Async/Await, \u0026 Error Handling\n\nSome extra topics I'm probably not going to cover:\n\n1. Prototypes and prototypal inheritance = will be a separate video dedicated to this topic.\n=\u003e I might include this in the course if there's enough time available (I believe YouTube has a 12 hour video limit)\n\n2. Memoization, dynamic programming, multi-dimensional arrays, other advanced algorithms\n\n=\u003e these will be in a separate course on coding interview skills / data structures and algorithms\n=\u003e these are not used very often in daily work, they're mostly useful for interviews\n\nHopefully, I am covering all the topics that were suggested.\n=\u003e Not sure when I'll be done  but I have started recording and editing."}]},"publishedTimeText":{"runs":[{"text":"2 years ago","navigationEndpoint":{"clickTrackingParams":"CFAQxKEDGAQiEwjxnbvLnquPAxUXX_UFHajBJCE=","commandMetadata":{"webCommandMetadata":{"url":"/post/Ugkx6d2UgEGVLA0BOR3wERMc81INvU4I0Lsb","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":247
